import {
    ComposedChart, XAxis, YAxis, Tooltip, ResponsiveContainer, Line, Dot
  } from 'recharts';

  const data = [
    { day: '01', age18_24: 19, age25_34: 28, age35_44: 47, age45plus: 51 },
    { day: '02', age18_24: 20, age25_34: 31, age35_44: 38, age45plus: 48 },
    { day: '03', age18_24: 23, age25_34: 25, age35_44: 39, age45plus: 51 },
    { day: '04', age18_24: 21, age25_34: 25, age35_44: 41, age45plus: 48 },
    { day: '05', age18_24: 22, age25_34: 28, age35_44: 43, age45plus: 48 },
    { day: '06', age18_24: 22, age25_34: 29, age35_44: 41, age45plus: 49 },
    { day: '07', age18_24: 18, age25_34: 31, age35_44: 41, age45plus: 49 },
    { day: '08', age18_24: 20, age25_34: 33, age35_44: 41, age45plus: 41 },
    { day: '09', age18_24: 21, age25_34: 32, age35_44: 37, age45plus: 52 },
    { day: '10', age18_24: 20, age25_34: 32, age35_44: 36, age45plus: 52 },
    { day: '11', age18_24: 18, age25_34: 29, age35_44: 38, age45plus: 48 },
    { day: '12', age18_24: 19, age25_34: 24, age35_44: 36, age45plus: 45 },
    { day: '13', age18_24: 20, age25_34: 33, age35_44: 39, age45plus: 46 },
    { day: '14', age18_24: 22, age25_34: 33, age35_44: 41, age45plus: 45 },
    { day: '15', age18_24: 21, age25_34: 33, age35_44: 41, age45plus: 45 },
  ];

  const colors = {
    age18_24: '#4DB4FF',
    age25_34: '#F4D548',
    age35_44: '#EB4D4B',
    age45plus: '#28B463',
  };

  const renderCustomLine = (dataKey, color) => (
    <Line
      type="monotone"
      dataKey={dataKey}
      stroke={color}
      strokeWidth={2}
      dot={{ r: 8, fill: color, stroke: '#fff', strokeWidth: 2 }}
      activeDot={false}
    />
  );

  const AttendeeAgeChart = () => {
    return (
      <ResponsiveContainer width="100%" height={300}>
        <ComposedChart data={data}>
          <XAxis dataKey="day" />
          <YAxis />
          <Tooltip />
          {renderCustomLine('age18_24', colors.age18_24)}
          {renderCustomLine('age25_34', colors.age25_34)}
          {renderCustomLine('age35_44', colors.age35_44)}
          {renderCustomLine('age45plus', colors.age45plus)}
        </ComposedChart>
      </ResponsiveContainer>
    );
  };

  export default AttendeeAgeChart;
